import React from 'react';
import { Navbar, Nav, Container } from 'react-bootstrap';
import { Link } from 'react-router-dom';


function NavBar() {
  return (
    <Navbar>
      <Container>
        {/* Navbar Brand di kiri */}
        <Navbar.Brand as={Link} to="/">Identifikasi Penyakit Padi</Navbar.Brand>

        {/* Toggle button untuk perangkat mobile */}
        <Navbar.Toggle aria-controls="navbar-nav" />

        {/* Navbar collapse untuk menu */}
        <Navbar.Collapse id="navbar-nav">
          {/* Nav items di kanan */}
          <Nav className="ms-auto"> {/* ms-auto mendorong ke kanan */}
            <Nav.Link as={Link} to="/">Home</Nav.Link>
            <Nav.Link as={Link} to="/about">Tentang Kami</Nav.Link>
            <Nav.Link as={Link} to="/diagnosis">Diagnosis</Nav.Link>
            <Nav.Link as={Link} to="/history">Riwayat</Nav.Link>
            <Nav.Link as={Link} to="/artikel">Artikel</Nav.Link>
            <Nav.Link as={Link} to="/auth">Login</Nav.Link>
          </Nav>
        </Navbar.Collapse>
      </Container>
    </Navbar>
  );
}

export default NavBar;
